INSERT INTO `field_data_field_extra_contact_info` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_extra_contact_info_value`, `field_extra_contact_info_format`) VALUES
('node', 'contact_info', 0, 188, 188, 'und', 0, '<h4>Uber Support Community</h4>\r\n<p>Connect with our Uber users to find and share the solutions on numerous use cases or get professional advice from our team. </p>', NULL),
('node', 'contact_info', 0, 189, 189, 'und', 0, '<h4>Uber Support Community</h4>\r\n<p>Connect with our Uber users to find and share the solutions on numerous use cases or get professional advice from our team.  </p>', NULL),
('node', 'contact_info', 0, 189, 189, 'und', 1, '<h4>Help</h4>\r\n<p>Need help? Don''t hestiate to ask us something. Email us directly info@joomlart.com or call us at <strong>00 1 650-253-0000</strong>. You can checkout our <a href="#" title="">FAQ</a> and <a href="#" title="">Help</a> page to get more information about our products.</p>', NULL);
INSERT INTO `field_data_field_feature_description` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_feature_description_value`, `field_feature_description_summary`, `field_feature_description_format`) VALUES
('field_collection_item', 'field_feature_details', 0, 377, 377, 'und', 0, 'We deliver a wide variety of block layouts which add endless personalisation.', NULL, NULL),
('field_collection_item', 'field_feature_details', 0, 378, 378, 'und', 0, 'Being trusted by 20.000+ amazing members so far. Best design for all at your choice.', NULL, NULL),
('field_collection_item', 'field_feature_details', 0, 379, 379, 'und', 0, 'A big number of customisable templates, packed with both handy features and design.', NULL, NULL),
('field_collection_item', 'field_feature_details', 0, 380, 380, 'und', 0, 'Our templates are updated each time a bug is discovered or there is new features.', NULL, NULL),
