('node', 'page', 0, 5, 5, 'und', 0, 'Sweep away boring static text', 'Sweep away boring static text', 'filtered_html'),
('node', 'page', 0, 6, 6, 'und', 0, 'For the moments to feature amazing things', 'For the moments to feature amazing things', 'filtered_html'),
('node', 'page', 0, 7, 7, 'und', 0, 'Showcase benefits, not just pricing', 'Showcase benefits, not just pricing', 'filtered_html'),
('node', 'page', 0, 8, 8, 'und', 0, 'For housing blockquotes that stand out', 'For housing blockquotes that stand out', 'filtered_html'),
('node', 'page', 0, 9, 9, 'und', 0, 'Compelling way to showcase images', 'Compelling way to showcase images', 'filtered_html'),
('node', 'page', 0, 10, 10, 'und', 0, 'Create visual impact with statistic figures', 'Create visual impact with statistic figures', 'filtered_html'),
('node', 'page', 0, 11, 11, 'und', 0, 'Your dedicated team at a glance', 'Your dedicated team at a glance', 'filtered_html'),
('node', 'page', 0, 12, 12, 'und', 0, 'Be organised into a set of dynamic tabs', 'Be organised into a set of dynamic tabs', 'filtered_html'),
('node', 'page', 0, 13, 13, 'und', 0, 'Just ask and get help now', 'Just ask and get help now', 'filtered_html'),
('node', 'hero', 0, 81, 81, 'und', 0, 'Start your <strong>coding  career</strong> and build things we are all <strong>proud of</strong>.', '', 'filtered_html'),
('node', 'hero', 0, 82, 82, 'und', 0, 'Simply choose pre-defined blocks and go explore in a variety of combinations. ', '', 'filtered_html'),
('node', 'hero', 0, 168, 168, 'und', 0, 'Faster service from anywhere. Take your service to the next level.', '', 'filtered_html'),
('node', 'hero', 0, 169, 169, 'und', 0, 'The most powerful extensions to extend your Website. <br>Cool features to add up to your site with easy integration steps following our guides. ', '', 'filtered_html'),
('node', 'hero', 0, 170, 170, 'und', 0, 'Connect to customers via completely open customer platform. ', '', 'filtered_html'),
('node', 'hero', 0, 171, 171, 'und', 0, 'Poweful marketing tool allows to connect with your customers. ', '', 'filtered_html'),
('node', 'hero', 0, 173, 173, 'und', 0, '<span>Explore our appealing collection of </span> <a href="#">Templates</a>  <span>to create ROI on your website.</span>', '', 'filtered_html'),
('node', 'hero', 0, 174, 174, 'und', 0, 'Make the best design even better, no mater the levels of sophistication. ', '', 'filtered_html'),
('node', 'hero', 0, 175, 175, 'und', 0, 'Dedicated, collaborative <br> workaholic people', '', 'filtered_html'),
('node', 'team', 0, 176, 176, 'und', 0, 'Diverse and talented workforce has helped to grow our capabilities.', '', 'filtered_html'),
('node', 'team', 0, 178, 178, 'und', 0, 'Meet just a few of the many dedicated, enthusiastic, collaborative and mildy workaholic people who add real edge and variety to our offering.', '', 'filtered_html'),
('node', 'team', 0, 179, 179, 'und', 0, 'We could not reach this far without such a hero team. Dedicated, collaborative and professional workaholic people.', '', 'filtered_html'),
('node', 'statistic', 0, 181, 181, 'und', 0, 'At this phase, we round up a collection of 12+ block types that feature typical content in Uber. Each block comes with multiple styles, giving you endless customisation possibility. ', '', 'filtered_html'),
('node', 'statistic', 0, 183, 183, 'und', 0, 'We deliver specialised services for clients in every industry, all over the world.', '', 'filtered_html'),
('node', 'statistic', 0, 184, 184, 'und', 0, 'The facts and figures on the power of visual content.', '', 'filtered_html'),
('node', 'contact_info', 0, 185, 185, 'und', 0, 'Need service or support? Submit your inquiry here and we’ll find you a solution.', '', 'filtered_html'),
('node', 'contact_info', 0, 187, 187, 'und', 0, 'Visit our store to experience the digital lifestyle with our latest product versions.', '', 'filtered_html'),
