('field_collection_item', 'field_feature_details', 0, 379, 379, 'und', 0, 'A big number of customisable templates, packed with both handy features and design.', NULL, NULL),
('field_collection_item', 'field_feature_details', 0, 380, 380, 'und', 0, 'Our templates are updated each time a bug is discovered or there is new features.', NULL, NULL),
