('field_collection_item', 'field_feature_details', 0, 426, 426, 'und', 0, 'We deliver a wide variety of block layouts which add endless personalisation.', '', 'filtered_html'),
('field_collection_item', 'field_feature_details', 0, 427, 427, 'und', 0, 'Being trusted by 20.000+ amazing members so far. Best design for all at your choice.', '', 'filtered_html'),
