('field_collection_item', 'field_feature_details', 0, 434, 434, 'und', 0, 'We deliver a wide variety of block layouts which add endless personalisation.', NULL, NULL),
('field_collection_item', 'field_feature_details', 0, 435, 435, 'und', 0, 'Being trusted by 20.000+ amazing members so far. Best design for all at your choice.', NULL, NULL),
('field_collection_item', 'field_feature_details', 0, 436, 436, 'und', 0, 'A big number of customisable templates, packed with both handy features and design.', NULL, NULL),
('field_collection_item', 'field_feature_details', 0, 437, 437, 'und', 0, 'Our templates are updated each time a bug is discovered or there is new features.', NULL, NULL),
('field_collection_item', 'field_feature_details', 0, 536, 536, 'und', 0, 'Drupal comes with many tools to help you organize, structure, find and re-use your content. Categorize with taxonomy, automatically create friendly path urls, create custom lists, associate content with other content on your site, and create smart defaults for content creators.', '', 'filtered_html'),
('field_collection_item', 'field_feature_details', 0, 537, 537, 'und', 0, 'Manage content with an easy-to-use web interface. Drupal''s flexibility handles countless content types including video, text, blog, podcasts, and polls with robust user management, menu handling, real-time statistics and optional revision control.', '', 'filtered_html'),
('field_collection_item', 'field_feature_details', 0, 538, 538, 'und', 0, 'Drupal comes with great options for new user accounts and user permissions. Users can be assigned one or more roles, and each role can be set up with fine-grained permissions allowing users view and create only what the administrator permits. The Drupal 7 admin theme makes administering a site easier than ever.', '', 'filtered_html'),
('field_collection_item', 'field_feature_details', 0, 539, 539, 'und', 0, 'Drupal''s focus on social publishing can help you create sites and applications to help your users express their opinions and engage with one another. You can have tight control over who can create, view, administer, publish and otherwise interact with content on your site.', '', 'filtered_html'),
('field_collection_item', 'field_feature_details', 0, 540, 540, 'und', 0, 'Build internal and external-facing websites in a matter of hours, with no custom programming. No need to start from scratch every time you build a new site, either. You can utilize a multi-site configuration or choose a Drupal distribution (installation profile). These provide a pre-defined configuration of site features and functions for a specific purpose or type of site, available as a single download.', '', 'filtered_html'),
('field_collection_item', 'field_feature_details', 0, 541, 541, 'und', 0, 'Drupal''s presentation layer allows designers to create highly usable, interactive experiences that engage users and increase traffic. Use an existing Drupal theme for your site, giving it an instant identity! If you can''t find one you like, try designing your own which others can use, too.', '', 'filtered_html'),
('field_collection_item', 'field_feature_details', 0, 542, 542, 'und', 0, 'With more than 16,000 available modules, the vast majority of your site''s requirements can be addressed with Drupal core and available add-on modules. Focus your efforts on building great web sites, not re-creating features available elsewhere. You can even contribute modules for others to use.', '', 'filtered_html'),
('field_collection_item', 'field_feature_details', 0, 543, 543, 'und', 0, 'Drupal makes it easy to connect your website to other sites and services across the web, using aggregation, feeds, and search engine connection capabilities. Social networking integration is also widely supported to help you engage with a wider audience. Drupal also offers your site easy ways to interact with external media and file services.', '', 'filtered_html'),
('field_collection_item', 'field_feature_details', 0, 544, 544, 'und', 0, 'At this phase, we round up typical blocks that Uber has to offer. Each block type comes with multiple styles.', '', 'filtered_html'),
('field_collection_item', 'field_feature_details', 0, 545, 545, 'und', 0, 'Each block has its own less file, so you have full control to define your own class and style.', '', 'filtered_html'),
('field_collection_item', 'field_feature_details', 0, 546, 546, 'und', 0, 'Completely separate content & design. No longer mixing HTML syntax embedded inside articles.', '', 'filtered_html'),
('field_collection_item', 'field_feature_details', 0, 547, 547, 'und', 0, 'Allow us to dig deeper into the modular block approach which eases our page management efforts.', '', 'filtered_html');
