INSERT INTO `field_revision_field_testimonial` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_testimonial_value`, `field_testimonial_format`) VALUES
('field_collection_item', 'field_testimonial_details_3', 0, 316, 316, 'und', 0, 'I can''t believe the warm decor and calmness you''ll get from beginning to end. I don''t want to leave and face the real world outside after being in this spa.', NULL),
('field_collection_item', 'field_testimonial_details_3', 0, 317, 317, 'und', 0, 'Wow, what a beautiful place!! Absolutely love them and your staff is very professional and experienced in permanent makeup. Try this place.....you will love it.', NULL),
('field_collection_item', 'field_testimonial_details', 0, 359, 359, 'und', 0, 'Wasn''t sure where to compliment. I just wanted to say I am so happy to be your customer. You make my life so easy, thanks for your great service.', NULL),
('field_collection_item', 'field_testimonial_details', 0, 360, 360, 'und', 0, 'We love the theme, it allows me to seek creativity. I set up my e-store without having to be a coding expert.', NULL),
('field_collection_item', 'field_testimonial_details_2', 0, 361, 361, 'und', 0, 'You make the tough decision to consult the different approach, but help us move forward with bold steps. Huge thanks for your team.', NULL),
('field_collection_item', 'field_testimonial_details_2', 0, 362, 362, 'und', 0, 'Very relaxing and thorough. Friendly staff will bring you awesome relaxation feeling the the moment you enter…Great prices as well.', NULL),
('field_collection_item', 'field_testimonial_details_3', 0, 363, 363, 'und', 0, 'I can''t believe the warm decor and calmness you''ll get from beginning to end. I don''t want to leave and face the real world outside after being in this spa.', NULL),
('field_collection_item', 'field_testimonial_details_3', 0, 364, 364, 'und', 0, 'Wow, what a beautiful place!! Absolutely love them and your staff is very professional and experienced in permanent makeup. Try this place.....you will love it.', NULL),
('field_collection_item', 'field_testimonial_details_4', 0, 365, 365, 'und', 0, 'We are very pleased with your design and programming talents and continue to rely on your good work. Sure we will get back to you as our site evolves going forward.', NULL),
('field_collection_item', 'field_testimonial_details_4', 0, 366, 366, 'und', 0, 'Your staff has been nothing less than professional and respectful. They are super patient and really listened to what I wanted. I would give you the top stars!', NULL),
('field_collection_item', 'field_testimonial_details_4', 0, 367, 367, 'und', 0, 'I can say without doubt that your team are a true pleasure to work with.  They are easy to communicate with which make process smooth. Highly recommended.', NULL),
('field_collection_item', 'field_testimonial_details_2', 0, 368, 368, 'und', 0, 'We have been very impressed by your team''s ability to deliver the design that perfectly symbolises our vision and evoke the stylish, elegant image we target.', NULL),
('field_collection_item', 'field_testimonial_details_2', 0, 369, 369, 'und', 0, 'Your deliverables impressed me on multiple levels. We are happy with the whole process and really admire your attention to detail and deep understanding of our needs.', NULL),
('field_collection_item', 'field_testimonial_details_2', 0, 370, 370, 'und', 0, 'Your combination of creativity and professionalism was exactly what we needed. He really listens to the client and is very patient in re-working until full satisfaction is achieved.', NULL),
('field_collection_item', 'field_testimonial_details_2', 0, 371, 371, 'und', 0, 'Your team has an exceptional ability to transform vision and direction into actionable creativity. No mater which levels of sophistication the work, you certainly create uniqueness.', NULL);
