INSERT INTO `field_revision_fi_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `fi_body_value`, `fi_body_summary`, `fi_body_format`) VALUES
('node', 'features_intro', 0, 147, 147, 'und', 0, 'A pretty exciting step forward to build layouts in a variety of combinations.', '', 'filtered_html'),
('node', 'features_intro', 0, 161, 161, 'und', 0, 'Simply choose pre-defined blocks and go explore in a variety of combinations.', '', 'filtered_html'),
('node', 'features_intro', 0, 162, 162, 'und', 0, 'A new way to prioritize content without deprecating design.', '', 'filtered_html'),
('node', 'features_intro', 0, 163, 163, 'und', 0, 'A pretty exciting step forward to build layouts in a variety of combinations.', '', 'filtered_html'),
('node', 'features_intro', 0, 164, 164, 'und', 0, 'Every single block has taken us incredible amount time for coding', '', 'filtered_html'),
('node', 'features_intro', 0, 165, 165, 'und', 0, 'Ready for the launch of our new template Uber. Idea for Startup.', '', 'filtered_html'),
('node', 'features_intro', 0, 193, 193, 'und', 0, 'Drupal is a publishing platform created by our vibrant community and bursting with potential. Use as-is or snap in any of thousands of free designs and plug-ins for rapid site assembly. Developers love our well-documented APIs. Designers love our flexibility. Site administrators love our limitless scalability.\r\nDrupal''s content management features make it easy to create and manage your site.', '', 'filtered_html');
