(193, 'node', ' drupal cms benefits drupal is a publishing platform created by our vibrant community and bursting with potential use asis or snap in any of thousands of free designs and plugins for rapid site assembly developers love our welldocumented apis designers love our flexibility site administrators love our limitless scalability drupal s content management features make it easy to create and manage your site style 4 fa fapencil organize find drupal comes with many tools to help you organize structure find and reuse your content categorize with taxonomy automatically create friendly path urls create custom lists associate content with other content on your site and create smart defaults for content creators fa faglobe creative content manage content with an easytouse web interface drupal s flexibility handles countless content types including video text blog podcasts and polls with robust user management menu handling realtime statistics and optional revision control fa fasearch administer drupal comes with great options for new user accounts and user permissions users can be assigned one or more roles and each role can be set up with finegrained permissions allowing users view and create only what the administrator permits the drupal 7 admin theme makes administering a site easier than ever fa fagroup collaborate drupal s focus on social publishing can help you create sites and applications to help your users express their opinions and engage with one another you can have tight control over who can create view administer publish and otherwise interact with content on your site fa facogs build build internal and externalfacing websites in a matter of hours with no custom programming no need to start from scratch every time you build a new site either you can utilize a multisite configuration or choose a drupal distribution installation profile these provide a predefined configuration of site features and functions for a specific purpose or type of site available as a single download fa famagic design and display drupal s presentation layer allows designers to create highly usable interactive experiences that engage users and increase traffic use an existing drupal theme for your site giving it an instant identity if you can t find one you like try designing your own which others can use too fa fapaperplaneo extend with more than 16000 available modules the vast majority of your site s requirements can be addressed with drupal core and available addon modules focus your efforts on building great web sites not recreating features available elsewhere you can even contribute modules for others to use fa fadrupal connect drupal makes it easy to connect your website to other sites and services across the web using aggregation feeds and search engine connection capabilities social networking integration is also widely supported to help you engage with a wider audience drupal also offers your site easy ways to interact with external media and file services  ', 0),
